import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from '../pages/Home';
import Blogs from '../pages/Blogs';
import FinDashboard from '../pages/FinDashboard';
import Login from '../pages/Login';

const AppRoutes = ({ language, theme }) => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home language={language} theme={theme} />} />
        <Route path="/blogs" element={<Blogs language={language} theme={theme} />} />
        <Route path="/fin" element={<FinDashboard language={language} theme={theme} />} />
        <Route path="/login" element={<Login language={language} theme={theme} />} />
      </Routes>
    </Router>
  );
};

export default AppRoutes;
